 //done\n    "tealium_badges": _satellite.getVar("CustJS - Tealium Badges")\n  };\n  var params = {}; \n  Object.keys(allParams).forEach(function(key) {\n    if(allParams[key].trim() != "") {\n      params[key] = allParams[key];\n    }\n  });\n  return params;\n}\n</script>',language:"html"},timeout:2e3,delayNext:!0},{modulePath:"adobe-target-v2/lib/loadTarget.js",settings:{}},{modulePath:"core/src/lib/actions/customCode.js",settings:{source:'<!-- Vendor: Adobe Target v2| -->\n<script>\ntry {\n\tdocument.addEventListener(adobe.target.event.REQUEST_SUCCEEDED, function(e) {\n\n        //set basic variables\n        var eventDetails = e.detail;    //success event data\n        var stringDetails = JSON.stringify(eventDetails);   //stringafy that event data\n        var eventRedirect = e.detail.redirect;  //redirect parameter from the event data\n        var tokens = e.detail.responseTokens;   //tokens from the event data\n        var ttStorage = sessionStorage.getItem(\'launch_adobe_target\');      //the session storage data from a prev redirect\n        \n        //debugging messages\n        _satellite.logger.info("adobe target initial event details: " + stringDetails);     \n        _satellite.logger.info("adobe target initial token details: " + JSON.stringify(tokens));     \n        \n        //if the test is a redirect, set tokens in sess storage\n        if(eventRedirect){  //set data into session storage then stop\n            sessionStorage.setItem("launch_adobe_target", JSON.stringify(tokens));\n            return;\n        }else{  \n            // the following if it\'s not a redirect\n            //set datalayer objects and tokens\n            window.digitalData = typeof(window.digitalData) != "undefined" ? window.digitalData : [];\n            window.digitalData.target = typeof(window.digitalData.target) != "undefined" ? window.digitalData.target : [];\n            window.dataLayer = typeof(window.dataLayer) != "undefined" ? window.dataLayer : [];\n            \n            //check session storage for dataz\n            if (!(isEmpty(ttStorage))) {\n                ttStorage = JSON.parse(sessionStorage.launch_adobe_target);\n                tokens = typeof(tokens) != "undefined" ? tokens : [];\n                tokens.push(ttStorage[0]);  //add sess storage data to tokens\n                sessionStorage.removeItem(\'launch_adobe_target\');  //delete sess storage data\n                _satellite.logger.info("adobe target final tokens details: " + + JSON.stringify(tokens));          \n            }\n            \n            //exit if "tokens" is undefined\n            if (isEmpty(tokens)) {\n                _satellite.logger.info("adobe target data did not track, tokens is empty");\n                //digitalData.error = "adobe target failed : no token";\n                return;\n            }\n            \n            //set variables for the loop\n            var uniqueTokens = distinct(tokens);    //list the tokens in case there are multiple\n            var i = 0;      //iterations used in the for loop\n            \n            //function for looping through tokens to send data to various places\n            uniqueTokens.forEach(function(token) {\n\n                //recheck for dd.target again (sometimes fails the first time), then push target data into dd\n                if (i=0){\n                    window.digitalData.target = typeof(window.digitalData.target) != "undefined" ? window.digitalData.target : [];\n                }\n                window.digitalData.target.push({\n                    \'activityName\': token["activity.name"],\n                    \'activityID\': token["activity.id"],\n                    \'experienceName\': token["experience.name"],\n                    \'experienceID\': token["experience.id"]\n                });\n\n                //set vars for the GA Rule in Launch in the format needed\n                var activityString = "(" + token["activity.id"] + ")" + token["activity.name"];\n                var experienceString = "(" + token["experience.id"] + ")" + token["experience.name"];\n\n                //send direct call for the GA rule in launch\n                if (typeof _satellite != "object") {\n                    _satellite.logger.error("target data did not track, no _satellite");\n                } else {\n                    _satellite.track("target-data", {\n                        activityName: activityString,\n                        experienceName: experienceString\n                    });\n                }\n                \n                //iterate\n                i = i + 1;\n            });\n        }\n\t});\n\n    //some more functions\n\tfunction isEmpty(val) {\n\t\treturn (val === undefined || val === null || val.length <= 0) ? true : false;\n\t}\n\n\tfunction key(obj) {\n\t\treturn Object.keys(obj)\n\t\t\t.map(function(k) {\n\t\t\t\treturn k + "" + obj[k];\n\t\t\t})\n\t\t\t.join("");\n\t}\n\n\tfunction distinct(arr) {\n\t\tvar result = arr.reduce(function(acc, e) {\n\t\t\tacc[key(e)] = e;\n\t\t\treturn acc;\n\t\t}, {});\n\t\treturn Object.keys(result)\n\t\t\t.map(function(k) {\n\t\t\t\treturn result[k];\n\t\t\t});\n\t}\n\n} catch (e) {\n\t_satellite.logger.error("failed to set target data event listener: " + e.message);\n}\n</script>',language:"html"}},{modulePath:"adobe-target-v2/lib/addPageLoadParams.js",settings:{params:{}}},{modulePath:"adobe-target-v2/lib/firePageLoad.js",settings:{bodyHiddenStyle:"body {opacity: 0}",bodyHidingEnabled:!1}}]},{id:"RLdccb3468d0b941bba10917ec3a07493d",name:"All Pages(Hostgator) - Library Loaded - Impact Radius",events:[{modulePath:"core/src/lib/events/libraryLoaded.js",settings:{},ruleOrder:50}],conditions:[{modulePath:"core/src/lib/conditions/domain.js",settings:{domains:["hostgator.com"]},timeout:2e3},{modulePath:"core/src/lib/conditions/valueComparison.js",settings:{comparison:{operator:"equals"},leftOperand:"%Sequence - Fire Tags (HG)%",rightOperand:"true"},timeout:2e3},{modulePat